/* (Beta) Export of data model Museum of the subject dataModel.PointOfInterest for a PostgreSQL database. Pending translation of enumerations and multityped attributes */
CREATE TYPE Museum_type AS ENUM ('Museum');
CREATE TABLE Museum (address JSON, alternateName TEXT, areaServed TEXT, artPeriod JSON, buildingType JSON, contactPoint JSON, dataProvider TEXT, dateCreated TIMESTAMP, dateModified TIMESTAMP, description TEXT, facilities JSON, featuredArtist JSON, historicalPeriod JSON, id TEXT PRIMARY KEY, location JSON, museumType JSON, name TEXT, openingHoursSpecification JSON, owner JSON, refSeeAlso JSON, seeAlso JSON, source TEXT, touristArea TEXT, type Museum_type);